import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Bin from './Bin';
import Item from './Item';
import * as serviceWorker from './serviceWorker';

var rect = document.getElementById('bin1');
console.log(rect.top, rect.right, rect.bottom, rect.left);
console.log("hello");
ReactDOM.render(<Item />, document.getElementById('root'));
ReactDOM.render(<Bin />, document.getElementById('bin1'));
ReactDOM.render(<Bin />, document.getElementById('bin2'));
ReactDOM.render(<Bin />, document.getElementById('bin3'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
